function createBoard () {

    let _count = 1;
 
    let count = 0;
 
    for(let i = 0; i < gridWidth; i++) {
        let headerCount = 0;

        for (let j = 0; j < gridHeight; j++) {
            numberArray.push(count);

            if (headerCount===0) {
                switch(i){
                    case 0:
                        cardB.push("B");
                        break;
                    case 1:
                        cardB.push("I");
                        break;
                    case 2:
                        cardB.push("N");
                        break;
                    case 3:
                        cardB.push("G");
                        break;
                    case 4:
                        cardB.push("O");
                        break;}
                buildRectangle(cardColor[0], i, j, count);
                colorTracker.push(0);
                colorTrackerBackup.push(0);
            } else {
                cardB.push(_count);
                _count++;
                buildRectangle(cardColor[i+2], i, j, count);
                colorTracker.push(i+2);
                colorTrackerBackup.push(i+2);
            }
            headerCount = 1;
            count++;
        }
    }
    shuffle(numberArray);
}

function refreshCards() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    let count = 0;
    for(let i = 0; i < gridWidth; i++) {

        for (let j = 0; j < gridHeight; j++) {
            buildRectangle(cardColor[colorTracker[count]], i, j, count);
            count++;
        }
    }

    if(bigNumberBool){
        showBigNumber();
    }
}

