//Fun with canvas! This was very difficult to nail... so proceed carefully.
function buildRectangle(myColor, j, i, k) {

    ctx.fillStyle = myColor;

    let width = ((canvasWidth/1.5) / gridWidth) - borderSpace;
    let height = (canvasHeight / gridHeight) - borderSpace;
    ctx.fillRect(j * ((canvasWidth/1.5) / gridWidth), i * (canvasHeight / gridHeight),width,height);
    ctx.strokeStyle = myColor;
    ctx.font = "small-caps bold " + fontSize + "px Arial";
    ctx.fillStyle = fontColor;
    ctx.textAlign = "center";

    ctx.fillText(cardB[k], j * ((canvasWidth/1.5) / gridWidth) + borderSpace+(width/2), (i * (canvasHeight / gridHeight)) + (canvasHeight / gridHeight / 2 )+(height/4));
}


//this is a standard array shuffler that I use a couple times in the code

function shuffle(array) {
    let currentIndex = array.length;
    let temporaryValue, randomIndex;
    while(randomIzer.length<gameCode){
        gameCode=gameCode/2;
    }
    let i = gameCode;

    // While there remain elements to shuffle...
    while (0 !== currentIndex) {

        // Pick a remaining element...
        randomIndex = Math.floor(randomIzer[i] * currentIndex);
        currentIndex -= 1;

        // And swap it with the current element.
        temporaryValue = array[currentIndex];
        array[currentIndex] = array[randomIndex];
        array[randomIndex] = temporaryValue;
        i++;
    }

    return array;
}

